<!DOCTYPE html>
<html>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, shrink-to-fit=no">
    <title>ZIP Travel Philippines</title>

    <style>
        body {
            margin: 0; 
            background-size: cover; 
            background-repeat: no-repeat; 
            background-image: url('/images/qr_link_bg.png');
            color: #FFFFFF;
        }

        .bg-fill {
            background-color: #0C1C33;
            opacity: .8;  
            height: 100vh; 
            width: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
            flex-direction: column;
        }

        .qr-header {
            display: flex;
            align-items: center;
            justify-content: center;
            flex-direction: column;
            margin-bottom: 50px;
        }

        .qr-header img {
            margin-bottom: 35px;
        }

        .qr-header p {
            font-weight: bold;
            font-size: 26px;
            text-align: center;
            margin: 0;
        }

        .qr-links {
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 35px;
            flex-direction: column;
            margin-bottom: 50px;
        }

        .qr-links a {
            color: #FFFFFF;
            text-decoration: none;
            font-weight: bold;
            padding: 25px 20px;
            border: #FFFFFF solid 2px;
            border-radius: 40px;
            width: 80%;
            text-align: center;
        }
        
        .qr-social-links {
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 30px;
            flex-direction: row;
        }
    </style>
</html>
<body>
    <div class="bg-fill">
